import React from 'react'
import nazwa_zdjecia from '.PlanWAT.jpg'
function Home() {
    return (
        <div className='home_main'>
            {/* Tutaj okoduje czesc lewa */}
            <div className="home_leftSide"></div>
            <img src={nazwa_zdjecia} alt='zdj1' />
            {/* Tutaj okoduje czesc prawa */}
            <div className="home_rightSide"></div>
            <div className='home_rightSide_text'>
                <div className='home_title'>TYTUŁ PORTALU</div>
                <div className='home_subtitle'>podtytuł strony internetowej</div>
            </div>

            <button className='home_button'>WCHODZĘ</button>


        </div>
    )
}

export default Home
